// Interrupt handler
void int_handler(void) {
    int flag;

    gba_register(INT_IME) = INT_IME_OFF;
    flag = gba_register(INT_IF);
    if (flag & INT_KEY) {
        gba_register(DMA_CTRL1) = 0;
        gba_register(TMR_CTRL0) = 0;
        gba_register4(DMA_DSTAD1) = SND_DAFIFO;
        gba_register4(DMA_SRCAD1) = (int) wave_data;
        gba_register(DMA_CTRL1) = DMA_ENABLE + DMA_INTREN + DMA_STARTFIFO + DMA_SIZE32 + DMA_REPEAT + DMA_SRCINC + DMA_DSTFIX;
        wavecnt = wave_length;
        gba_register(TMR_CTRL0) = TMR_ENABLE + TMR_1CLOCK;
    }
    if (flag & INT_DMA1) {
        wavecnt -= 16;
        if (wavecnt <= 0) {
            gba_register(TMR_CTRL0) = 0;
            gba_register(DMA_CTRL1) = 0;
        }
    }
    gba_register(INT_IF) = flag;
    gba_register(INT_IME) = INT_IME_ON;
}